import React from "react";
import Table_column_child from "./Table_column_child";

function Table_column(props){

    const style_table_column1_child = ["border-bottom","border-bottom bg-primary","pt-2"]; 
    const style_table_column2_child = ["flex-wrap border-start bg-secondary","flex-wrap border-start"]
    const style_table_column3_child = ["flex-wrap border-start bg-danger","flex-wrap border-start"]
    const style_table_column4_child = ["border-bottom bg-secondary","border-bottom"]
    const style_table_column5_child = ["border-bottom border-start-0 border-0","border-bottom border-start-0 bg-success border-0","border-bottom"]
    const style_table_column6_child = ["flex-wrap border-end border-start-0 bg-secondary border-0","flex-wrap border-end border-start-0 border-0"]
    const style_table_column7_child = ["flex-wrap border-end border-start-0 bg-warning border-0","flex-wrap border-end border-start-0 border-0"]
    const style_table_column8_child = ["border-top bg-secondary","border-top"]

    

    return(
        <div className={`${props.style_column}`}>
            <Table_column_child table_column_child={`${props} style_table_column1_child`}/>
        </div>
    )
}
export default Table_column;
